function Footer() {
    return (
        <div id="page-container">
          
            <footer className="navbar-expand-sm navbar-dark bg-secondary" id="footer">
            <div className="content has-text-centered">
                <p>
                    <strong> neyneyalldayday</strong>
                </p>
            
            </div>
            </footer>
            
           
        </div>
        
    )
}

export default Footer;
